async () => {
		//Call CIN API to get the address
		await selectCINDetails.run();
		storeValue('vayIndCCIN', InputCIN.text);
		storeValue('vayCinRegAddrr1',selectCINDetails.data[0].CIN_ADDRESS_LINE1);
		storeValue('vayCinRegAddrr2',selectCINDetails.data[0].CIN_ADDRESS_LINE2);
		storeValue('vayCinRegCity',selectCINDetails.data[0].CIN_ADDRESS_CITY);
		storeValue('vayCinRegDistrict',selectCINDetails.data[0].CIN_ADDRESS_DISTRICT);
			storeValue('vayCinRegState',selectCINDetails.data[0].CIN_ADDRESS_STATE);
		storeValue('vayCinRegCountry',selectCINDetails.data[0].CIN_ADDRESS_COUNTRY);
			storeValue('vayCinRegPinCode',selectCINDetails.data[0].CIN_ADDRESS_ZIP);	
			storeValue('vayCinRegPlace',selectCINDetails.data[0].CIN_REG_PLACE);
		storeValue('vayCinRegDate',selectCINDetails.data[0].CIN_REG_DATE);		
		//showAlert(appsmith.store.vayCinRegAddrr1 + appsmith.store.vayCinRegAddrr2)
		UpdateBusinessFinancierDetails.run();		
			navigateTo('India Corporate Address', {});
	}

